    false,nt"url": null,nt"notes": "This narrative report for Calhoun National
    Wildlife Refuge outlines Refuge accomplishments from September through December
    of 1946. The report begins by summarizing the weather conditions, water conditions,
    and food and cover during this period. Wildlife including migratory birds, upland
    game birds, big game animals, and furbearers is also covered. The public relations
    section of the report describes Refuge visitors, hunting, and violations. NR forms
    are attached.",nt"license_title": "License Not Specified",nt"extras":
